const BASE_URL = '/evaluation-service'; 

const API_TOKEN = 'eyJhbGciOiJIUzI1NiIsInR5cCI6IkpXVCJ9..R5ZBJUyC3jhixY58pyFU_cOmcZK0rxlZfbmGsZwGOW4'; // ✅ REPLACE THIS with your actual token

export const fetchStockPrices = async (stockSymbol, minutes = 30) => {
  try {

    const response = await fetch(`${BASE_URL}/stocks/${stockSymbol}?minutes=${minutes}`, {
      headers: {
        'Authorization': `Bearer ${API_TOKEN}`,  
        'Content-Type': 'application/json'
      }
    });

   
    if (!response.ok) {
      const errorText = await response.text();
      console.error('API Error:', response.status, errorText);
      throw new Error(`Fetch failed: ${response.status} - ${errorText}`);
    }

   
    const json = await response.json();

   
    console.log('Fetched data:', json);

   
    return json;
  } catch (err) {
    
    console.error('Network/API error:', err);
    throw err; 
  }
};
